insert into `command_task_message` (`id`, `message`, `task_value_id`) values (3, 'ehi\nprimo freestyle\n2 0 2 0\nnuova vita\nsto in cameretta a scrivere co\' \'na matita\nco\' \'ste parole la scena viene demolita\ne la vinco io questa cazzo di partita\nspacco la traccia si fra, ti spacco la faccia\ntu quano rappi sembri arrugginito\nle tue rime così squallide che rimango basito\ndici tanto che il tuo rap sfonda\nmi sa che con tutte le cavolate che spari affonda\nil mio rap ti sfonda\nil tuo sprofonda...\nseh fra\nil tuo sprofonda...\nehi..\nokay che con queste rime t\'ho già rotto il culo\ne t\'assicuro che per te non c\'è futuro quindi te censuro\ne se vuoi fare una cosa bona bevete er cianuro\nte e pornhub sembrate ciccio col suo paguro\nsente l\'attacco che te sferro ti piace predere il ferro nell\'ano da tizi come tiziano ferro\nallora vuoi pure la fama ti sputo in faccia tipo lama\nio vado, sono il re del rap ancora, chiama.', 4);
insert into `command_task_message` (`id`, `message`, `task_value_id`) values (4, 'ehi...\nsenti...\nsono qui come un coglione a sfogarmi\nlo faccio perché non so se ridere o disperarmi\ni sentimenti son\' come la polvere\nrimangono nel cuore e ti fa scorrere\nla luce della speranza quella che gli uomini rinchiudono nella stanza\nscusate se faccio rime da cazzaro, non sono nè rapper nè metallaro\nquello che sono non è per nulla chiaro\nma la metrica come un faro ad illuminare il mio cammino\nquello da casa mia allo strozzino\nquello che mi separa da uno spacciatore è che voglio vivere senza rossore\nvoglio dire ai miei figli: \"nella vita non fate i conigli, quando vostro padre rum vive quelle che a casa vostra son finite\nperché gli uomini son polvere che nel vento nel deserto vedi sciogliere\"', 5);
insert into `command_task_message` (`id`, `message`, `task_value_id`) values (5, 'Impara\nPenso al futuro ma vivo il presente\nNon ha senso fare progetti se non sai fare niente\nFino a ieri annegavo tra i dubbi, le mie insicurezze\nMi hanno imparato a trasformare i sogni in certezze\nHo scoperto il rap da poco\nOra lo scrivo come se fosse un gioco\nSfodero un sorriso davanti all\'obiettivo, scelgo una posa e metto a fuoco\nE\' bello pensare a quanto è facile sfondare\nNel mondo della musica non ricevi senza dare\nAccendi la radio senti una canzone\nHai l\'impressione che anche per te ci sia un\'occasione\nMa non serve a nulla il talento se c\'è corruzione\nLa Mafia è un vulcano in continua eruzione\nEhy...\nEhy...\nVedi cio che vuoi ma la realtà è diversa\nSe pensi che si avrà giustizia è una scommessa persa\nNon c\'è bisogno che mi ringrazi, per me è un passatempo\nIn futuro sarà un lavoro, perchè continuo a crederci e non penso al tempo\nOra, se vuoi essere onesto dammi ciò che mi spetta\nPerchè prima degli altri ho raggiunto la vetta', 6);
insert into `command_task_message` (`id`, `message`, `task_value_id`) values (6, 'ti parlo della mia città\ndove per ogni ragazzino della mia età\nl’unica persona che conta \nè avere la pistola pronta\nma fate come  minchia volete\nanzi continuate così fin quando non vi stancherete\ne restate chiusi nella vostra mentalità\nnella vostra provincialità\ncomplici della criminalità e della malavita\nse pensate così non avete capito un cazzo  della vita\ne leccate ancora il  culo ai vostri amici\nChe in realtà sono figli dei nostri nemici\ne non venirmi a dire “Oh, cazzo dici?!”\nDico solo quello che penso di questa città\ne dico che questa città è la feccia dell’umanità\nanche se a chiamarla così gli dò già troppa importanza\nraga è solo un paesino di me.rda con molta ignoranza\nma lo capite o no chi è importante?\nnon è quel figlio di puttana che ammazza gente avvolte innocente\nio li definirei di più malati di mente!\nma forse sono l’unico stron.zo sfigato a pensarla così\nraga ho capito me ne andrò via di qui', 7);
