insert into `command_task_message` (`id`, `message`, `task_value_id`) values (17, '```javascript\n/**\n    * lista:\n    * ID => ID elemento\n    * nome => nome elemento\n    * IDgruppo =>ID raggruppamento\n    * nome_gruppo => Nome Raggruppamento\n    *\n*/\nlet lista_rette = <?= json_encode($select_rette); ?>;\n$(\'.filtra_trattamenti\').data(\'id\', <?= json_encode($trattamenti_selezionati); ?>);\ntooltip_multiselect_generico_group($(\'.filtra_trattamenti\'), lista_rette, (filtro_rette) => {\n    inizia_ricerca_griglia_preseza();\n});\n```\n```html\n<div class=\"div_select__tooltip filtra_trattamenti\"    style=\"font-size:12px;width: 100%;\" ></div>\n```', 19);
insert into `command_task_message` (`id`, `message`, `task_value_id`) values (18, '```javascript\n/**\n    * lista:\n    * ID => ID elemento\n    * nome => nome elemento\n    * IDgruppo =>ID raggruppamento\n    * nome_gruppo => Nome Raggruppamento\n    *\n*/\nlet lista_categorie = <?= json_encode($select_categoria) ?>;\ntooltip_select_generico_group($(\'.tooltip_alloggio\'), lista_categorie, (newIDcategoria) => {\n      gestrestcat(IDcategoria, 87, newIDcategoria, 10, 13);\n});\n```\n```html\n<div class=\"div_select__tooltip  tooltip_alloggio\" data-id=\"\' . $IDcliente . \'\" data-key=\"\'. $valore .\'\" style=\"font-size:12px;width:150px\"></div>\n```', 20);
